description:
The Other Ones 
August 23, 2000
Coors Amphitheatre
Chula Vista, CA


You might as well call this the &quot;DARK STAR&quot; show.  :)


I rarely post audience recordings.  However, I ONLY post Audience recordings that are of spectacular sounding quality and performance.  ENJOY!


